bundle_code: "'''\n\n'''\n\nfrom  ambry.bundle.loader import ExcelBuildBundle\n \n\
    class Bundle(ExcelBuildBundle):\n    ''' '''\n\n    @staticmethod\n    def nonnumber(v):\n\
    \        # The OSHPD ID is a float, but should be a varchar, so this will get\
    \ rid of the '.0' at the end\n        try:\n            return str(int(v))\n \
    \       except ValueError:\n            return v\n\n    @staticmethod\n    def\
    \ excel_date(v):\n        pass # We'll be overwriting this func when the workbook\
    \ datemode is known. \n\n    def build_modify_row(self, row_gen, p, source, row):\n\
    \        \n        row['year'] = int(source.time)\n        \n\n    def meta(self):\n\
    \        \"\"\"Fix some pathalogical datatypes that the intuiter gets wrong. \"\
    \"\"\n        r = super(Bundle, self).meta()\n        \n        self.prepare()\n\
    \        \n        with self.session:\n            for t in self.schema.tables:\n\
    \                for c in t.columns:\n                    \n                 \
    \   if 'acqui_means' in c.name:\n                        c.datatype = 'varchar'\n\
    \                        \n                    if 'acqui_dt' in c.name or '_value_'\
    \ in c.name or 'projtd' in c.name:\n                        c.datatype = 'integer'\n\
    \                              \n        self.schema.write_schema()\n        \n\
    \        return r\n        \n    \n    def row_gen_for_source(self, source_name):\n\
    \        \"\"\" Total hack to set the datemode for excel date conversion. \"\"\
    \"\n        \n        rg = super(Bundle, self).row_gen_for_source(source_name)\n\
    \        \n\n        self.excel_date = rg.make_date_caster()\n        \n     \
    \   return rg\n        \n        \n        \n        \n        \n"
